import React, { useState } from 'react'

const ImageGallerySwitcher = () => {
  const imageUrls = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
  ]
  const [index, setIndex] = useState(0);
  const next = () => setIndex((index + 1) % imageUrls.length);
  const prev = () => setIndex((index - 1 + imageUrls.length) % imageUrls / length);
  return (
    <>
      ImageGallerySwitcher
      <img src={imageUrls[index]} alt="Gallery view" /><br />
      <button onClick={prev} style={{margin:'10px'}}>PreviousImage</button><br />
      <button onClick={next} style={{margin:'10px'}}>NextImage</button>
    </>
  )
}

export default ImageGallerySwitcher